	('edb98afc-2e9f-4c39-b38b-41a90698c260', '87796288-6847-4a37-aae1-26317d42c7ee', '56168d52-8572-499a-8188-57555ecef3f0', 'Summer 2024 Nurse Recruitment', 'Thank you for completing the interview.', '{"Can you tell me about your nursing background and what inspired you to pursue a career in nursing?","What areas of nursing have you specialized in, and why did you choose those specialties?","How do you prioritize patient care when dealing with multiple patients with different levels of acuity?","Can you describe a time when you had to handle a medical emergency? What steps did you take, and what was the outcome?","How do you stay updated with the latest medical advancements and practices in nursing?","You’re working with a patient post-surgery, and they suddenly report difficulty breathing. What immediate actions would you take?","You notice that a patient’s medication dosage is incorrect on the chart. What steps would you follow to resolve this issue?","How do you handle conflict within a healthcare team, especially when it comes to differences in patient care approaches?","Can you give an example of how you''ve collaborated with doctors or other healthcare professionals to improve patient outcomes?","How do you ensure that patients feel comfortable and cared for during their hospital stay?","Describe a time when you provided emotional support to a patient or their family during a difficult situation.","What do you think is the most important quality a nurse should possess, and how do you embody that in your work?","How do you maintain work-life balance while working in a demanding healthcare environment?","What are your career goals in nursing, and how do you see yourself growing in this profession?"}', 30, 'Why did you choose nursing as a career?', 'Welcome to the nursing interview!', '30 minutes', '{"Answer all questions","Take your time"}', '/images/instructions-cover.png', 'https://resource.heygencdn.com/AIAvatars/caption.mp4', '{"This interview will assess your skills"}', '2024-10-18 14:10:25.891157+00', '2024-10-18 14:10:25.891157+00', 'interview_completed', 'e7d5ff76-fab3-444b-be00-9fca3e0185c2', 'b253058d-5cbc-46da-8b67-8c9b26c13b77'),
	('b17c2016-11e7-47bc-811e-75551acf69b7', '87796288-6847-4a37-aae1-26317d42c7ed', '4d6bfac8-d9dc-4224-a1a1-3db0479b1f1b', 'Summer 2023 Nurse Recruitment', 'Thank you for completing the interview.', '{"Ask follow-up questions if needed","Provide clear instructions"}', 10, 'Background and Experience:
- Can you walk me through your most recent experience at [specific company or job]? What were your primary responsibilities in your most recent role?
- What specific patient populations have you worked with, and what challenges did you face in those settings?
- Can you describe a situation where you had to advocate for a patient? What was the outcome?
- What nursing specialties are you most passionate about? Follow-up: Why did you choose [mentioned] areas?

Skills and Competencies:
- Your resume mentions [specific skill or certification]. Can you elaborate on how you’ve applied this in your previous roles?
- How do you prioritize tasks when managing multiple patients? Can you provide an example?
- Can you discuss your experience with electronic health records (EHR) systems? Which platforms have you used?
- What strategies do you use to maintain effective communication with your team and patients?

Education and Professional Development:
- How has your education prepared you for your nursing career? Are there specific courses or experiences you found particularly valuable?
- What additional training or certifications are you currently pursuing or interested in?

Feedback and Self-Assessment:
- Reflecting on your previous roles, what feedback have you received from supervisors or peers? How have you used this feedback to improve your practice?
- What do you consider your greatest strength, and how does it benefit your patients and team?

Career Goals and Fit:
- What are you looking for in your next nursing position? Are there specific elements of a job that are particularly important to you?
- How do you envision your career progressing in the next few years? What steps are you taking to achieve those goals?
- What type of work environment do you thrive in, and why?

Location and Type of Roles:
- Are you open to traveling or relocating for your next position? If so, which locations interest you?
- Which other types of roles will you consider that may provide a career path to the [job candidate is interested in] role?

Closing:
- Is there anything else from your resume or experience that you feel is important for us to discuss?
- Do you have any questions for me?
